    final List<List<int>> exerciseTargetIndexesIndexes = [];
    final exerciseTargetIdsToSkip = [];
    for (var i = 0; i < exerciseTargets.length; i++) {
      final currentExerciseId = exerciseTargets[i].exercise!.id;
      final currentExerciseTargetId = exerciseTargets[i].id;
      if (exerciseTargetIdsToSkip.contains(currentExerciseTargetId)) {
        continue;
      }

      final List<GSessionFragment_exerciseTargets> exerciseTargetsToAdd = [
        exerciseTargets[i]
      ];

      final List<int> exerciseTargetIndexesIndexesToAdd = [i];

      var offset = 1;
      while (true) {
        if (i + offset >= exerciseTargets.length) {
          break;
        }
        final nextExerciseTarget = exerciseTargets[i + offset];
        final nextExerciseId = nextExerciseTarget.exercise!.id;
        if (currentExerciseId == nextExerciseId) {
          exerciseTargetsToAdd.add(nextExerciseTarget);
          exerciseTargetIndexesIndexesToAdd.add(i + offset);
          final nextExerciseTargetId = nextExerciseTarget.id;
          exerciseTargetIdsToSkip.add(nextExerciseTargetId);
          offset++;
        } else {
          break;
        }
      }

      organizedExerciseTargets.add(exerciseTargetsToAdd);
      exerciseTargetIndexesIndexes.add(exerciseTargetIndexesIndexesToAdd);
    }

