using System;

namespace Events
{
    delegate void DeadHandler(Enemy enemy);

    internal class Program
    {
        static Random _random = new Random();
        static void Main(string[] args)
        {
            DeadHandler handler = WriteDeadMessage;
            handler += AciveMentOnLook;
            Enemy[] enemies =
            {
                new Enemy(WriteDeadMessage),
                new Enemy(handler),
                new Enemy(WriteDeadMessage)
            };

            while (true)
            {
                Enemy randomEnemy = enemies[_random.Next(0, enemies.Length)];
                randomEnemy.TakeDamage(_random.Next(0, 10));
            }
        }

        static void AciveMentOnLook(Enemy enemy)
        {
            Console.WriteLine("Acive OnBlook");
        }

        static void WriteDeadMessage(Enemy enemy)
        {
            Console.WriteLine($"{enemy} - is Dead");
        }
    }

    class Enemy
    {
        private int _health = 100;

        public DeadHandler OnEnemyDead;
        public bool IsDead => _health <= 0;

        public Enemy(DeadHandler onEnemyDead)
        {
            OnEnemyDead = onEnemyDead;
        }

        public void TakeDamage(int damage)
        {
            if (!IsDead)
            {
                _health -= damage;

                if (IsDead)
                    OnEnemyDead?.Invoke(this);
            }
        }
    }
}

